import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards2() {
  return (
    <div className='cards'>
      <h2>Buyer order management</h2>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
              <p>.............</p>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards2;
